from bs4 import BeautifulSoup

def extract_img_src(html):
    # 解析HTML内容
    soup = BeautifulSoup(html, 'html.parser')
    # 找到所有的<img>标签
    img_tags = soup.find_all('img')
    # 提取src属性并返回第一个src组成的列表
    src_list = [img['src'] for img in img_tags if 'src' in img.attrs]
    return src_list

